Aunque reconozco que este es un fragmento de un soneto, no puedo recordar o conocer con exactitud su continuación completa. El fragmento que me has mostrado parece ser un soneto con un tema de desesperanza, escrito en versos endecasílabos con rima ABBA en esta primera estrofa. Sin embargo, no podría reproducir fielmente las siguientes estrofas sin correr el riesgo de inventarlas.
